 assert!(Rc::strong_count(&key_one) == 2 && Rc::strong_count(&key_two) == 1);

 match set.entry(key_two.clone()) {
     Entry::Occupied(entry) => {
         let old_key: Rc<String> = entry.replace();
         assert!(Rc::ptr_eq(&key_one, &old_key));
     }
